import React from 'react';

function Shayari({ id, title, author, content, likes, dislikes, onLike, onDislike }) {
    return (
        <div className='shayari-card'>
            <h2>{title}</h2>
            <h4>{author}</h4>
            <p>{content}</p>
            <p>
                <button onClick={onLike}>Like</button> {likes}
            </p>
            <p><button onClick={onDislike}>Dislike</button>: {dislikes}</p>
        </div>
    );
}

export default Shayari;
